package Collections;

import java.util.*;
public class ArryListForloop {

	//for loop
	
		public static void main(String[] args)
		{
			// TODO Auto-generated method stub
			 ArrayList<String> al=new ArrayList();
				
				al.add("Ganesh");
				al.add("Rajesh");
				al.add("Venu");
				al.add("Surya");
				al.add("Vivek");
				for(String n: al)//enhanced for-loop
				{
					System.out.println(n);
				}
				

		}

	}
	

